import React from 'react'
import { connect } from 'react-redux';
const SignUp = () => {
    return (
        <div>
            SignUp
        </div>
    )
}


const mapDispatchToProps = (dispatch) => {
    return {
        setIdToken: (newToken) => { dispatch({type: 'SET_NEW_TOKEN', token: newToken}) }
    }
}

export default connect(mapDispatchToProps)(SignUp);
